}, {
  name: `Sentinel-class landing craft`,
  description: `Designed by Sienar Fleet Systems, the Sentinel-class shuttle was a larger-scale troop transport used by the Empire. Much like its cousin, the Lambda-class shuttle, these vehicles featured three wings in a triangular layout: a stationary center foil and two articulated flanking wings. Imperials used the shuttle for missions that spanned the galaxy, from a search for droids on Tatooine to conflicts with the Lothal rebels.`,
