}, {
  name: `Slave 1`,
  description: `A powerful pursuit craft made famous by Jango Fett in the days of the Republic, this ship was inherited by Boba Fett for his career as a bounty hunter. The aged but effective ship is loaded with hidden defensive and offensive weaponry and equipment, and has a reputation earned from decades of successfully capturing fugitives.`,
