}, {
  name: `Imperial shuttle`,
  description: `An elegant example that stands apart from typical brutish Imperial engineering, the Lambda-class shuttle is a multi-purpose transport used in the Imperial starfleet. The Empire pressed the shuttle into service for both cargo ferrying and passenger duty. Even the Empire's elite, like Darth Vader and the Emperor Palpatine used these shuttles. It has three wings: a stationary center foil and two articulated flanking wings. When in flight, the side wings fold out for greater stabilization. When landing, the wings fold in, shrinking the vessel's silhouette.The well-armed vessel has two forward-facing double laser cannons, two wing-mounted double cannons, and a rear-facing double laser cannon. It is equipped with a hyperdrive.`,
  starshipImgSrc: `https://lumiere-a.akamaihd.net/v1/images/veh_ia_1752_040381b2.jpeg`
}, {
  name: `EF76 Nebulon-B escort frigate`,
  description: `These versatile rebel cruisers were often used to escort rebel convoys, protecting ships from Imperial patrols with an array of powerful turbolasers and tractor beams. After his confrontation with Darth Vader on Cloud City, Luke Skywalker recovered from his injuries aboard a Nebulon-B medical frigate. These escort ships were part of the rebel armada that assaulted the second Death Star at Endor.`,
  starshipImgSrc: `https://lumiere-a.akamaihd.net/v1/images/nebulon-b-frigate_dce53bc2.jpeg`
}, {
  name: `Calamari Cruiser`,
  description: `The gentle Mon Calamari people brought more than their determination to restore freedom to the galaxy when they joined the Rebel Alliance. They also brought a fleet of powerful capital ships. These immense vehicles were a startling contrast to the straight-lined shapes favored by the Imperial fleet. Whereas the Imperial Star Destroyer resembles a pointed dagger in shape, a Mon Calamari cruiser lacks hard angles, and is covered with ovoid forms suggesting an organic sculpture. Despite their smooth lines, these vessels pack an enormous punch. Turbolasers, ion cannons, tractor beam projectors and shield generators dot the flowing surface of the ships.`,
