}, {
  name: `B-wing`,
  description: `Perhaps the oddest-looking starfighter in the Rebel Alliance fleet, the B-wing fighter is as powerful as it is ungainly. The ship's structure is almost entirely taken up by its primary airfoil, which houses a cylindrical cockpit on one end, an engine cluster in the center, and a heavy weapons pod at its base. Located just below the engine cluster are a pair of S-foils which can deploy to extend the firing arc of twin laser cannons. The B-wing's command pod has a unique gyroscopic control system. The pilot can orient it so that it always stays level with a horizon line. No matter which way the B-wing may maneuver laterally, its pilot remains upright.`,
  starshipImgSrc: `https://lumiere-a.akamaihd.net/v1/images/databank_bwingfighter_01_169_460cc528.jpeg`
}, {
  name: `Republic Cruiser`,
  description: `The distinctive shape and hue of a Republic Cruiser is instantly recognizable throughout the galaxy, indicating a vessel on a mission for the Galactic Senate, the Supreme Chancellor, or the Jedi Order. Chancellor Valorum dispatched a Republic Cruiser carrying two important Jedi ambassadors to negotiate an end to the Trade Federation Blockade of Naboo. The cruiser docked within a Trade Federation battleship's cavernous landing bay. On the orders of Darth Sidious, the Trade Federation ambushed the Jedi ambassadors. The crew of the cruiser was caught by surprise, destroyed by a concealed turbolaser turret.`,
  starshipImgSrc: `https://lumiere-a.akamaihd.net/v1/images/databank_republiccruiser_01_169_fd769e33.jpeg`
}, {
  name: `Droid control ship`,
  description: `The Lucrehulk-class Droid Control Ship was one of the many warships used by the Trade Federation and the Separatist Navy, and arguably the most important weapon in their arsenals. Droid Control Ships were used to coordinate battle droid armies`,
