  name: `AA-9 Coruscant freighter`,
  description: `In the days leading up to the Clone Wars, these ships were transports favored by refugees trying to escape Coruscant since travelers had no need to register themselves. It was for that reason that Jedi Master Mace Windu suggested this method of transportation to then-padawan Anakin Skywalker when he was escorting Senator Amidala back to Naboo after an attempt on her life. The ships were outfitted with everything needed to carry a massive amount of people of various species across the galaxy, including cafeterias and various servant droids.`,
  starshipImgSrc: `https://lumiere-a.akamaihd.net/v1/images/aa-9-coruscant-freighter_a856053d.jpeg`
}, {
  name: `Jedi starfighter`,
  description: `These wedge-shaped one-man starfighters were built for the Jedi Order. The Delta-7’s designers worked with the Jedi to create a starfighter for pilots with Force-aided reflexes, stripping down the fighters’ systems and making their controls as responsive as possible. With skilled pilots such as Anakin Skywalker and Saesee Tiin at the controls, Delta-7s were lightning-quick in combat, darting in for attack runs and then skipping nimbly away from retaliatory fire. During one famous encounter, Obi-Wan Kenobi piloted a Delta-7 through Geonosis’s planetary ring, pursued by Jango Fett in his starship Slave I. Plo Koon was piloting his Delta-7 above Cato Neimoidia when Chancellor Palpatine ordered the clones to execute Order 66. Plo’s wingman caught the Jedi General by surprise and blew his fighter out of the sky.`,
