  name: `H-type Nubian yacht`,
  description: `The H-Type Nubian yacht was a sleek luxury yacht and what it lacked in weapons it made up for in style and a strong deflector shield. The signature silver finish is a mark that the ship belongs to a former member of Naboo’s monarchy. Padme Amidala used a ship like this after her J-Type diplomatic barge was destroyed in an assassins attack. It was an H-Type that whisked Padme and Anakin Skywalker from Naboo to Tatooine, and then to Geonosis where the Clone Wars would begin.`,
  starshipImgSrc: `https://lumiere-a.akamaihd.net/v1/images/h-type-nubian-yacht_7d67bc00.jpeg`
}, {
  name: `Republic Assault ship`,
  description: `The Acclamator-class assault ship, alternatively referred to as the Acclamator-class trans-galactic military transport ship or Acclamator-class transgalactic military assault ship, or by the shorter names Acclamator-class transport, Acclamator-class troopship, or the rarer Acclamator I transport, was an assault-class capital ship created for the Galactic Republic by Rothana Heavy Engineering. It was the predecessor of the later Republic and Imperial models in the Star Destroyer line.`,
  starshipImgSrc: `https://static.wikia.nocookie.net/starwars/images/7/70/Acclamator-TCWIV.png`
}, {
  name: `Solar Sailer`,
  description: `Built by the Geonosians, Count Dooku’s Punworcca 116-class interstellar swoop was an example of a solar sailer, a beautiful and expensive ship notable for the sails it would unfurl for interstellar flight. Dooku’s solar sailer brought him from Geonosis to Coruscant after the opening battle of the Clone Wars, and he later lent solar sailers to his apprentices Asajj Ventress and Savage Opress.`,
  starshipImgSrc: `https://lumiere-a.akamaihd.net/v1/images/databank_geonosiansolarsailer_01_169_b3873578.jpeg`
}, {
  name: `Trade Federation cruiser`,
  description: `The Trade Federation Cruiser was a type of wedge-shaped capital ship utilized by the Trade Federation Droid Army around the time of the Clone Wars. The cruiser possessed several laser cannons but used cruise missiles as its primary weapons. One was destroyed in 22 BBY by the Lok Revenants.`,
